import axios from 'axios';
const { REACT_APP_ALPHA_API_KEY } = process.env;

const URL = 'https://www.alphavantage.co/query?function=GLOBAL_QUOTE&symbol=';
const API = process.env.REACT_APP_ALPHA_API_KEY;


class PolygonModel {
    static search = (query) => {
      return axios.get(`https://www.alphavantage.co/query?function=GLOBAL_QUOTE&symbol=${query}&apikey=${API}`, {
            mode: 'no-cors'
        })
    }
}

